import React from 'react';
import PostCard from "./PostCard";

const PostList = () => {
    return (
        <div className="p-3">
            <div className="flex justify-between gap-4">
                    <h2>Related Articles</h2>
                    <button>Read More</button>
            </div>
            <PostCard vertical={true} />
        </div>
    );
};

export default PostList;
